		swingometer.oninput = function() {
			var shlabs = (100 - minormeter.value - swingometer.value).toFixed(2);
			var shcons = (0 - (0 - swingometer.value)).toFixed(2);
			labs.innerHTML = shlabs + "%";
			cons.innerHTML = shcons + "%";
			var swingcon = shcons - 29.29;
			var swinglab = shlabs - 36.25;
			var totswing = (swingcon - swinglab) / 2;
			
			if (totswing > 0) {
				swinglabel.style = "color:#0087dc;";
				swinglabel.innerHTML = (totswing).toFixed(2) + "% to CON";
			}
			if (totswing < 0) {
				swinglabel.style = "color:#b22222;";
				swinglabel.innerHTML = (0 - totswing).toFixed(2) + "% to LAB";
			}
			if (totswing == 0) {
				swinglabel.style = "color:#000000;";
				swinglabel.innerHTML = "no swing";
			}
			transitionModel(shcons, shlabs);
		}

			for (var i = 0; i < originalScores.length; i++) {                           // for constituency #i
				sVc[i] = [0,0,0,0,0,0,0,0,0];
				sVk[i] = 0;
				// removing swinging voters
				for (var j = 0; j < 9; j++) {                         // for party #j
					sVc[i][j] = Math.floor(originalScores[i][j] * Math.max(0,1 - newSupport[j]/oldSupport[j])); // number of voters leaving party #j in constituency #i
					sVk[i] = sVk[i] + sVc[i][j];                      // add to tally of swinging voters for seat #i
				}
				// redistributing swinging voters
				var winningHere = 0;
				var winningVotes = 0;
				for (var j = 0; j < 9; j++) {
					if (newSupport[j] > oldSupport[j]) {                                                // for parties gaining votes,
						prediction[i][j] = originalScores[i][j] + sharei[j] * sVk[i];                  // add the proportion of swing voters the party deserves.
					} else {                                                                            // for parties losing votes,
						prediction[i][j] = originalScores[i][j] * (newSupport[j] / oldSupport[j]);     // scale their votes down by swing ÷ original.
					}
					if (prediction[i][j] > winningVotes) {   // if party #j has most votes so far in seat #i,
						winningVotes = prediction[i][j];     // reset the highest vote number to party #j's
						winningHere = j;                     // write down that the winning party is party #j.
					}
				}
				// who wins?
				codeArray[winningHere].push(i);				// write the seat ID (i) in the winning party's codeArray.
			}
			for (var j = 0; j < 9; j++) {
				codeArray[j].shift();                                            // for some reason each array started with the array number, this removes it
				for (var m = 0; m < codeArray[j].length; m++) {               // convert from the array to the code string
					codeString = codeString + (codeArray[j][m] + 1) + "a";   // from 0-319 to 1-320
				}
				codeString = codeString + "0b";
			}
			document.getElementById("listinput").value = codeString;
	//		var n = graphx.length;
	//		graphx[n] = shrendafs;
	//		grapha[n] = codeArray[2].length - 1;
	//		graphr[n] = codeArray[6].length - 1;
	//		console.log(graphx[n] + "," + grapha[n] + "," + graphr[n]);
	//		ctx.fillStyle = "#a4243b";
	//		ctx.fillRect(shrendafs * 5,350 - grapha[n],1,1);
	//		ctx.fillStyle = "#4385f1";
	//		ctx.fillRect(shrendafs * 5,350 - graphr[n],1,1);
			colourMap();
		}
		
		
		
			function generateColour(partyID,vote) {
			var colourArray = ["b22222","faa61a","fff890","0087dc","6ab023","9400d3","ffd700","44532a","999999"];
			var todaysColour = colourArray[partyID];
			var todaysRed = parseInt(todaysColour.substring(0,2),16);
			var todaysGreen = parseInt(todaysColour.substring(2,4),16);
			var todaysBlue = parseInt(todaysColour.substring(4,6),16); // original party colours as 0 to 255
			vote = 1 - vote / 50000; // vote as 0 to 1
			var newRed = Math.max(16,Math.floor(todaysRed + vote * (255 - todaysRed))).toString(16);
			var newGreen = Math.max(16,Math.floor(todaysGreen + vote * (255 - todaysGreen))).toString(16);
			var newBlue = Math.max(16,Math.floor(todaysBlue + vote * (255 - todaysBlue))).toString(16); // vote as original party colour to ff
			return newRed.concat(newGreen,newBlue); // returns a hex colour code with no hash
		}
		function doTheBoxThing(message) {
			document.getElementById("percentThing").innerHTML = message;
		}
		function partypercent(partyID) {
			for (var i = 0; i < 1795; i++) {
				if (document.getElementById("con" + i) != null) {
					var parColour = generateColour(partyID,prediction[i - 1][partyID]);
					console.log("Constituency con" + i + " has " + prediction[i - 1][partyID]/1000 + "% of vote and will be given the colour " + parColour);
					document.getElementById("con" + i).style.fill = parColour;
					// var themessage = document.getElementById("par" + i).firstElementChild.innerHTML.concat(": ".concat((Math.floor(prediction[i - 1][partyID]/1000)/10).toString().concat("%")));
					var themessage = (Math.floor(prediction[i - 1][partyID]/100)/10).toString().concat("%");
					// document.getElementById("par" + i).onmouseover = "doTheBoxThing(" + themessage + ")";
					document.getElementById("con" + i).firstElementChild.innerHTML = themessage;
				} else { console.log("con" + i + " returned null"); }
			}
		}
